import React from "react";

const About = () => {
  return (
    <div className="about bg-teal-100 h-100 p-10 mt-6 absolute left-0 ml-14 pr-15 rounded-md">
      <h1 className="font-body font-bold text-white text-4xl mb-4">About Us</h1>
      <div className="text-lg mb-4 font-light">
        Not sure what to cook using the ingredients you have at home?
        <br />
        Find healthy and delicious recipes here! Cooking more meals at home{" "}
        <br />
        gives everyone in the family an opportunity to build better eating
        habits, <br />
        one plate at a time.
      </div>
    </div>
  );
};

export default About;
